export function statusToLabel(status) {
  if (status === 'healthy') return 'Healthy';
  if (status === 'careful') return 'Careful';
  if (status === 'warning') return 'Warning';
  if (status === 'unable') return 'Unable to Report';
  return 'N/A';
}
